import React from "react";
import { NavLink } from "react-router-dom";
class Navbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      role: this.props.user,
    };
  }

  render() {
    return (
      <>

        <NavLink to={"/Exam"}>
          <button>Exam</button>
        </NavLink>
        {this.state.role === "SuperAdmin" && (
          <NavLink to={"/Users"}>
            <button>User</button>
          </NavLink>
        )}
      </>
    );
  }
}
export default Navbar;
